import React from 'react';
// import PodcastCard from './PodcastCard';

const Popular = ({ podcasts }) => {

        console.log('popularpodcasts', podcasts);
        return (
            <div>
                {
                    podcasts.map(podcast => {
                        return <li>{podcast.email}</li>
                    })
                }
            </div>
        )    
    
}

export default Popular;
